import React from 'react';
import styled from 'styled-components';
import { colors } from '../styles';

const Foot = styled.footer`
  background-color: ${colors().grey};
  min-height: 200px;
`;

function Footer() {
  return <Foot></Foot>;
}

export default Footer;
